import React, { useState, useEffect } from "react";
import { useParams } from "react-router-dom";
import axios from "axios";

function LiveQuizInterface() {
  const { quizId } = useParams();

  const [quiz, setQuiz] = useState();

  useEffect(() => {
    axios
      .get(`http://localhost:4000/getQuizById/${quizId}`)
      .then((response) => {
        const { quiz } = response.data;
        setQuiz(quiz);
      })
      .catch((error) => {
        console.log(error);
      });
  });

  return (
    <div
      style={{
        height: "100vh",
        width: "100vw",
        backgroundColor: "#041325",
        display: "flex",
      }}
    >
      <div
        style={{
          height: "80vh",
          width: "86vw",
          backgroundColor: "#FFFFFF",
          marginLeft: "7vw",
          marginRight: "12vw",
          marginTop: "10vh",
          marginBottom: "10vh",
        }}
      ></div>
    </div>
  );
}

export default LiveQuizInterface;
